-- DROP TABLE IF EXISTS `service_site`;
CREATE TABLE `service_site` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(100) NOT NULL COMMENT '网点名称',
  `site_code` varchar(40) DEFAULT NULL COMMENT '所属站点编号',
  `country_id` varchar(30) DEFAULT NULL COMMENT '国家代码',
  `country_name` varchar(50) DEFAULT NULL COMMENT '国家名称',
  `province_id` varchar(30) DEFAULT NULL COMMENT '省/邦/区域代码',
  `province_name` varchar(100) NOT NULL COMMENT '省/邦/区域名称',
  `city_id` varchar(30) DEFAULT NULL COMMENT '城市代码',
  `city_name` varchar(100) NOT NULL COMMENT '城市名称',
  `address` varchar(500) NOT NULL COMMENT '网点详细地址',
  `phone_number` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `longitude` varchar(20) DEFAULT NULL COMMENT '经度',
  `latitude` varchar(20) DEFAULT NULL COMMENT '纬度',
  `post_code` varchar(20) DEFAULT NULL COMMENT '邮编',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '网点状态，0-禁用，1-启用',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '网点类型，1-独家，2-授权，3-接收点',
  `repair_level` tinyint(4) DEFAULT NULL COMMENT '维修级别',
  `open_time_week` varchar(50) DEFAULT NULL COMMENT '营业时间（星期）',
  `open_time` varchar(50) DEFAULT NULL COMMENT '营业时间',
  `close_time` varchar(50) DEFAULT NULL COMMENT '休息时间（星期）',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注信息',
  `owner_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '归属类型，1-realme，2-oppo',
  `assess_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '审核状态，0-已保存，1-待审核，2-审核通过，3-驳回',
  `assess_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '审核类型，1-新增，2-撤销 ，3-信息变更',
  `assess_data` varchar(3000) DEFAULT NULL COMMENT '审核数据',
  `created_by` int(10) DEFAULT NULL COMMENT '创建人',
  `updated_by` int(10) DEFAULT NULL COMMENT '更新人',
  `created_at` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `updated_at` bigint(20) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16496 DEFAULT CHARSET=utf8mb4 COMMENT='服务网点信息表';

